export default class App extends Component {
  render () {
    return (
      <div>
        <Router>
        <Navbar />

        <Switch>
          <Route path="/"><News pageSize={5} country="in" category="general"/></Route>
          <Route path="/business"><News pageSize={5} country="in" category="general"/></Route>
          <Route path="/"><News pageSize={5} country="in" category="general"/></Route>
          <Route path="/"><News pageSize={5} country="in" category="general"/></Route>
          <Route path="/"><News pageSize={5} country="in" category="general"/></Route>

        </Switch>

        </Router>
      </div>
    );
